import React,{useState, useEffect, use} from "react";
import PartService from "../services/PartService";

const PartList = () => {
    const [parts, setParts] = useState([]);

    useEffect(() => {
        PartService.getAllParts()
            .then(response => {
                setParts(response.data);
            })
            .catch(error => {
                console.error("There was an error fetching the parts!", error);
            }); 
    }, []);
    return (
  <div>
    <div className="wc-table-header">
      <h2 className="wc-table-title">Part List</h2>
      <div className="wc-table-actions">
        <button className="btn btn-sm btn-outline-primary">Create Part</button>
        <button className="btn btn-sm btn-outline-secondary ms-2">Export List</button>
      </div>
    </div>

    <table className="table table-striped table-sm wc-table">
      <thead>
        <tr>
          <th>ID</th>
          <th>Name</th>
          <th>Version</th>
          <th>State</th>
        </tr>
      </thead>
      <tbody>
        {parts.map(part => (
          <tr key={part.id}>
            <td>{part.partNumber}</td>
            <td>{part.name}</td>
            <td>{part.version}</td>
            <td>{part.lifecycleState}</td>
          </tr>
        ))}
      </tbody>
    </table>
  </div>
);

}
export default PartList;
